import React, { Component } from "react";

class Selector extends React.Component {
  render() {
    return (
      <div className="m-2">
        <span className="me-2">{this.props.selector.lab} </span>
        <div className="btn-group">
          <input
            type="checkbox"
            className="btn-check"
            id="btn-check"
            autocomplete="off"
          />
          <label className="btn btn-outline-primary" for="btn-check">
            {this.props.selector.opt1}
          </label>
          <input
            type="checkbox"
            className="btn-check"
            id="btn-check"
            autocomplete="off"
          />
          <label className="btn btn-outline-primary" for="btn-check">
            {this.props.selector.opt2}
          </label>
        </div>
      </div>
    );
  }
}

export default Selector;
